■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>飲みやすいソフトカプセル!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5406/1064316-01.jpg" width="600" height="600"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">【お召し上がり方】<br>1日4カプセルを目安に、水またはぬるま湯と共にお召し上がりください。<br><br>【販売元】<br>株式会社ユーワ<br>東京都武蔵村山市伊奈平1-51-2</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">DHA(ドコサヘキサエン酸)とEPA(エイコサペンタエン酸)は、不飽和脂肪酸の一種で常温では固まらない性質をもち、マグロなどの脂肪の多い魚に多く含まれています。DPA(ドコサペンタエン酸)は特にアザラシなどの海洋哺乳類の脂肪に多く含まれる不飽和脂肪酸です。本品は、DHAが46％、EPAが28％含まれた精製魚油とハープシーオイル(アザラシオイル)を使用し、4粒中にDHA220mg、EPA216mg、DPA7mg含有しています。</font></td></tr></table><br><!--栄養成分・原材料表ここから--><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">栄養成分</font></td><td width="75%"><font color="#333333" size="-1">【4カプセル(1720mg)当たり】<br>熱量:12.8kcal、タンパク質:0.36g、脂質:1.2g、炭水化物:0.16g、ナトリウム:0.96mg</font></td></tr><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">原材料</font></td><td width="75%"><font color="#333333" size="-1">精製魚油(EPA、DHA含有)、ハープシーオイル(DPA含有)、ゼラチン、グリセリン、ビタミンE</font></td></tr></table><br><!--栄養成分・原材料表ここまで--><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">DHA(ドコサヘキサエン酸)とEPA(エイコサペンタエン酸)は、不飽和脂肪酸の一種で常温では固まらない性質をもち、マグロなどの脂肪の多い魚に多く含まれています。DPA(ドコサペンタエン酸)は特にアザラシなどの海洋哺乳類の脂肪に多く含まれる不飽和脂肪酸です。本品は、DHAが46％、EPAが28％含まれた精製魚油とハープシーオイル(アザラシオイル)を使用し、4粒中にDHA220mg、EPA216mg、DPA7mg含有しています。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">51.6g(1粒重量430mg(1粒内容量290mg)×120粒)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：6×6×11cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：210g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">商品区分：健康食品</font><br><font color="#333333" size="-1">名称：DHA含有魚油加工食品</font><br><font color="#333333" size="-1">保存方法：直射日光、高温多湿を避け、冷暗所にて保存してください。</font><br> <font color="#333333" size="-1">賞味期間：製造日より1,260日</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
