■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>EPA・クリルオイル・DHA含有の栄養補助食品!!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5280/5910bt-01.jpg" width="536" height="800"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">【お召しあがり方】<br>栄養補助食品として1日3粒を目安にそのまま水またはぬるま湯と一緒にお召し上がり下さい。<br><br>【保存方法】<br>直射日光や湿気の多いところを避け、涼しいところに保存してください。<br><br>【ご使用上の注意】<br>※本品は、自然原料を使用しているため、粒の色が若干変わることがありますが、品質には影響ありません。<br>※開封後はなるべく早めにお召し上がり下さい。<br>※カプセルどうしがくっつくことがありますが、スプーンなどで軽くかき混ぜると離れます。<br>※乳幼児の手の届かないところに保管して下さい。<br>※体質や体調によって、まれに体に合わない場合があります。その場合は摂取を中止して下さい。<br>※授乳・妊娠中の方、乳幼児および小児は摂取をお控え下さい。<br>※療中の方は主治医にご相談下さい。<br>※食品によるアレルギーが認められる方は、原材料名をご確認下さい。<br>※直射日光や湿気の多いところを避け、涼しいところに保存して下さい。<br>※食生活は、主食、主菜、副菜を基本に、食事のバランスを心がけて下さい。<br><br>【販売者】<br>マルマン株式会社<br>東京都千代田区外神田1-8-13</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">話題の「ω-3系脂肪酸(オメガ3)」が多く含まれているEPA・DHAを含有しています。また、海中に生息するプランクトンの一種である南極オキアミから得られる「クリルオイル」も含有しており、毎日の基本サプリメントとしておすすめです。</font></td></tr></table><br><!--栄養成分・原材料表ここから--><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">栄養成分</font></td><td width="75%"><font color="#333333" size="-1">【3粒(1.41g)あたり】<br>熱量:10.07kcal、たんぱく質:0.37g、脂質:0.92g、炭水化物:0.08g、ナトリウム:0.71mg、ビタミンE:10.05mg</font></td></tr><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">原材料</font></td><td width="75%"><font color="#333333" size="-1">EPA含有精製魚油、DHA含有精製魚油、クリルオイル、ゼラチン、グリセリン、ビタミンE</font></td></tr></table><br><!--栄養成分・原材料表ここまで--><!--その他アレルギーここから--><!--保存方法と製造（販売）者情報ここから--><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">話題の「ω-3系脂肪酸(オメガ3)」が多く含まれているEPA・DHAを含有しています。また、海中に生息するプランクトンの一種である南極オキアミから得られる「クリルオイル」も含有しており、毎日の基本サプリメントとしておすすめです。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">商品区分</font></td><td width="75%" align="left"><font color="#333333" size="-1">健康食品</font></td></tr><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">28.2g(470mg×60粒)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：10×2×16cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：31g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">名称：EPA含有精製魚油加工食品</font><br><font color="#333333" size="-1">賞味期間：製造日より900日</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
