■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>魚油に含まれるDHAとEPAに加えてDPAも配合。</strong></font></td></tr></table><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="center"><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0144/9194z-01.jpg" width="600px" height="902px" ><br><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#999999"><tr><td bgcolor="#FFFFCC"><table width="100%" border="0" cellpadding="3" cellspacing="0"><tr><th><font color="#FF0000">------ ココがポイント！ ------</font></th></tr><tr><td><strong><font size="3" color="#FF9900">●魚が苦手で不足している方に</font></strong></td></tr></table></td></tr></table><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><font size="3">食品として、1日に1カプセル程度を目安に水などでお召し上がり下さい。万一、体質に合わない場合はご利用を中止して下さい。天然由来の成分を主として使用しているため、多少色のバラツキが生じる場合がございますが、品質には全く問題ありません。<br><br>【原材料】<br>DHA含有精製魚油、ゼラチン、ハープシールオイル、グリセリン、酸化防止剤(V.E、カテキン)<br><br>【栄養成分表示】(1カプセル440mgあたり)<br>エネルギー3.21kcal<br>たんぱく質0.12g<br>脂質0.30g<br>炭水化物0.004g<br>ナトリウム0.06mg<br>DHA111mg<br>EPA15.3mg<br>DPA2.4mg</font></td></tr></table><br><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><br><font size="3">DHA(ドコサヘキサエン酸)とEPA(エイコサペンタエン酸)は、どちらも魚油に多く含まれており、「n-3系」と呼ばれる多価不飽和脂肪酸です。DPAはEPAの10倍のパワーがあると言われています。体内でつくることが難しい成分ですので、積極的に食品から摂取しなければなりません。近年食の欧米化によって、青魚を食べる機会が減ってしまっている現代人にお勧めの一品です。</font></td></tr></table></td></tr></table><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">DHA(ドコサヘキサエン酸)とEPA(エイコサペンタエン酸)は、どちらも魚油に多く含まれており、「n-3系」と呼ばれる多価不飽和脂肪酸です。DPAはEPAの10倍のパワーがあると言われています。体内でつくることが難しい成分ですので、積極的に食品から摂取しなければなりません。近年食の欧米化によって、青魚を食べる機会が減ってしまっている現代人にお勧めの一品です。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">79.2g(440mg×180カプセル)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：12×3.5×21cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">90g<br>個装重量160g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">区分：健康食品<br>名称：精製魚油含有食品<br>販売者：補完医療製薬株式会社　大阪市中央区谷町9-2-27-303Ａ<br>保存方法：直射日光、高温多湿を避けて保存して下さい。<br>賞味期限：製造日より720日</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
